# BubbleSort algorithm written from notes from DataStructures
function bubbleSort(list)
	numberOfSwaps = 0
	numberOfComparisons = 0
	len = length(list)
	for i = 1:len-1
		for j = 2:len
			numberOfComparisons += 1
			if list[j-1] > list[j]
				tmp = list[j-1]
				list[j-1] = list[j]
				list[j] = tmp
				numberOfSwaps += 1
			end
		end
	end
end


